import React from "react";
import { Navbar, Container, Nav } from "react-bootstrap";

function Header() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">
          <img
            src="https://www.google.com/imgres?q=fpt%20logo&imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fvi%2Fthumb%2F2%2F2d%2FLogo_Tr%25C6%25B0%25E1%25BB%259Dng_%25C4%2590%25E1%25BA%25A1i_h%25E1%25BB%258Dc_FPT.svg%2F2560px-Logo_Tr%25C6%25B0%25E1%25BB%259Dng_%25C4%2590%25E1%25BA%25A1i_h%25E1%25BB%258Dc_FPT.svg.png&imgrefurl=https%3A%2F%2Fvi.wikipedia.org%2Fwiki%2FT%25E1%25BA%25ADp_tin%3ALogo_Tr%25C6%25B0%25E1%25BB%259Dng_%25C4%2590%25E1%25BA%25A1i_h%25E1%25BB%258Dc_FPT.svg&docid=m4TC1oZ8GQnHJM&tbnid=UQaLZQX9Lmbw-M&vet=12ahUKEwjtsbif9M-LAxU4sVYBHTXCGlkQM3oECBYQAA..i&w=2560&h=998&hcb=2&ved=2ahUKEwjtsbif9M-LAxU4sVYBHTXCGlkQM3oECBYQAA" // Thay thế bằng đường dẫn tới logo của bạn
            alt="FPT Education Logo"
            height="30"
            className="d-inline-block align-top"
          />{" "}
          FPT University
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            {" "}
            {/* Đẩy các liên kết sang phải */}
            <Nav.Link href="#home">Trang chủ</Nav.Link>
            <Nav.Link href="#major">Ngành học</Nav.Link>
            <Nav.Link href="#admission">Tuyển sinh</Nav.Link>
            <Nav.Link href="#student">Sinh viên</Nav.Link>
          </Nav>
          {/* Form tìm kiếm */}
          <form className="form-inline">
            <input
              className="form-control mr-sm-2"
              type="search"
              placeholder="Search"
              aria-label="Search"
            />
          </form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
